import Slider from "react-slick";
import React,{Component} from 'react';
import antd from "antd";
import reactdom from "react-dom"   ;
const { Carousel } = antd;
class Slid extends Component {
    
    render() { 
        return ( 
            <Carousel autoplay>
            <div>
              <h3>1</h3>
            </div>
            <div>
              <h3>2</h3>
            </div>
            <div>
              <h3>3</h3>
            </div>
            <div>
              <h3>4</h3>
            </div>
          </Carousel>
         );
    }
}
 export default Slid;
